import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for navigation
import './About.css'; // Import the CSS file for About page

const About = () => {
  return (
    <div className="about-page">
      {/* Navbar */}
      <nav className="navbar">
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
        </div>
      </nav>

      {/* About Title and Description */}
      <header className="about-header">
        <h1 className="about-title">About Our Project</h1>
        <p className="about-description">
          This is the About page. Learn more about the purpose of this project, the features we offer, and our goals.
        </p>
      </header>

      {/* Post Cards in About Page */}
      <div className="cards-grid">
        {[1, 2, 3, 4, 5].map((card) => (
          <div key={card} className="card">
            <h3>Post Title {card}</h3>
            <p>This is a sample description for post {card}.</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default About;
